import { Route, BrowserRouter as Router, Routes, Redirect, Switch } from 'react-router-dom';
import './App.css';
import Users from './Components/Users';
import AddUser from './Components/AddUser';
import Login from './Components/Login';
import Register from './Components/Register';
import Dashboard from './Components/Dashboard';

function App() {
  const [userRoleId, setUserRoleId] = React.useState(null);

  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/login">
            <Login onLogin={(roleId) => setUserRoleId(roleId)} />
          </Route>
          <Route path="/dashboard">
            {userRoleId ? <Dashboard userRoleId={userRoleId} /> : <Redirect to="/login" />}
          </Route>
          <Redirect to="/login" />
        </Switch>
      </Router>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Users />} />
          {/* <Route path="/Login" element={<Login />} /> */}
          <Route path="/AddUser" element={<AddUser />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
